;a:1:{s:7:"caption";s:1736:"“Forgive So That You Can Make Space For Your Blessings”

Your head is in the clouds. You are torn between two people. You are focused on something from the past that didn’t work out; something that you broke off. There was deception, someone was removed from the picture, and you continuing to daydream about what could have been is blocking you from a new beginning in love; essentially, holding on to the energy of this relationship that had to end is blocking you from receiving the experience you prayed for.

The crane communicates that, “you will soon enter into a beneficial partnership. Luck and longevity bless this union.” It is time for you to forgive yourself, forgive the person that hurt you with their deceptive behaviors, and release yourself of this karma. The light coming through the clouds tells me that you know what you have to do, it’s just a matter of taking action towards it. Spend some time in meditation and connect with your higher self, with God. All the answers we need come from within, so ask for a sign if you are still feeling unsure about the recent decision you made. I assure you in this reading that you did, but it is only natural that you feel the way you do. Surrender your thoughts to God and trust that He is in control, trust that what he removes, he always replaces with far more than you can imagine.

